(876, 0, 1, 'ALLEGHENY CO DEPT OF HUMAN SERVICES', 'Event and Donations Manager', 'Ondrea L Burton', '<p>The Event and Donations Team manages five signature events each year. Additionally, it undertakes the solicitation for and distribution of donated goods and services on behalf of the people served through DHS. The team also assists staff in other DHS offices with their event- / donation-planning processes. Event and Donations Team Signature Events Project Prom (March - April) Project Prom provides formal attire to high schools students receiving services or eligible to receive services through DHS, through donations from retail establishments and the general public. Senior Celebration in the Park (May) Senior Celebration honors older adult residents of Allegheny County with a day of fun and learning that brings together free nutritious meals, health screenings, resource vendors, live entertainment and prizes at South Park. Candidates&rsquo; Comedy Night (August) A fundraiser for the Allegheny County Music Festival Fund, Candidates&rsquo; Comedy Night gives candidates for local, state and national</p>\r\n', '412-350-3683', '', 'Ondrea.Burton@AlleghenyCounty.US', 'www.alleghenycounty.us/DHS', 'http://www.facebook.com/ACDHS', 'http://twitter.com/ACDHS', '', '', 'One Smithfield St', 'Ste 100', '', 0, 'PA', 'US', '15222', '', '', '', '', 'ALLEGHENY CO DEPT OF HUMAN SERVICES', 'ALLEGHENY CO DEPT OF HUMAN SERVICES', 'ALLEGHENY CO DEPT OF HUMAN SERVICES', 'allegheny-co-dept-of-human-services', 1, '2014-08-01 00:00:00', '2014-10-13 04:40:21'),
