INSERT INTO `bs_cmspages` (`id`, `parent_id`, `lft`, `rght`, `title`, `body`, `meta_title`, `meta_keyword`, `meta_desc`, `slug`, `status`, `created`, `modified`) VALUES
(1, NULL, 1, 2, 'About Us', '<p><strong>Connie Portis</strong> is the founder and co-publisher of the Greater Pittsburgh Black Business Directory and Resource Guide. A former president of the National Black Pages Association, Portis and her brother Richard are celebrating their 26th year of consecutive publishing of the Black Business Directory.</p>\r\n\r\n<p><strong>What is the Black Business Directory?</strong><br />\r\nThe Greater Pittsburgh Black Business Directory is a community resource for locating African Americans in business in the Greater Pittsburgh area and to communicate additional businesses, resources and services available to build and enhance opportunities in the community. Black Pages and Black Business Directories are published in print and online in over 55 cities nationwide and abroad representing more than 100,000 plus business.</p>\r\n\r\n<p><strong>Why a Black Business Directory?</strong><br />\r\nThe purpose of a black business directory is to level the playing field for African Americans in the marketplace and for majority-owned businesses to reach the African American market in a medium primarily targeted to them.</p>\r\n\r\n<p><strong>Who can advertise in the Black Business Directory?</strong><br />\r\nAdvertisers include African Americans in business sales, service and management and other companies and agencies that have an interest in reaching the African American community.</p>\r\n\r\n<p><strong>Who will use the Black Business Directory?</strong><br />\r\nThe Greater Pittsburgh Black Business Directory will be used by consumers, tourists, purchasing agents, and others looking for goods, services and resources targeted to the African American community. It also serves as a great business-to-business connection.</p>\r\n\r\n<p><strong>Three Convenient Sections in the Black Business Directory:</strong><br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n <li><strong>White Pages</strong> - consumer products and services. In addition to business listings, this section includes cover bios of the featured business and professional people on the cover</li>\r\n  <li><strong>Yellow Pages</strong> - Corporate purchasing and vendor listings. A useful business resource section is contained in this section</li>\r\n  <li><strong>Blue Pages</strong> - Agencies, organizations and educational and employment services. This section includes the Black Church Directory</li>\r\n</ul>\r\n\r\n<p><strong>How can I obtain a copy of the print edition?</strong><br />\r\nPrinted copies are distributed at businesses, agencies, churches and organizations. For a cost of $9.95 a Greater Pittsburgh Black Business Directory will be mailed directly to a home or office. Contact us for larger quantities (412) 391-8208.</p>\r\n\r\n<p><strong>What are my options to be included?</strong><br />\r\nWe have a two-tiered pricing structure - small business and corporate. Small non-profit agencies qualify for the small business rates.</p>\r\n\r\n<p><strong>Do I have to have a prepare ad?</strong><br />\r\nNo. As a service to our clients we will assist you, at no additional cost, with your advertising copy.</p>\r\n\r\n<p><strong>Can I advertise online only?</strong><br />\r\nOnline advertising is free for our print advertisers who submit, free of charge, an ad for the rotating boxes on right-hand side of the website. The center banner ad is available free to full pages advertisers for six months and $500 for six months for non-advertisers. The center banner will rotate with up to ten advertisers. Call (412) 391-8208 to secure advertising in these areas or go to the advertising rates.</p>\r\n', 'About Us', 'pittsburgh black business directory,pittsburgh business,black business directory,pittsburgh business directory,connie portis,richard portis, pittsburgh calendar, pittsburgh black community, african americans, pittsburgh', 'Pittsburgh black businesses, black church directory,community agencies and organizatons', 'about-us', 1, '2014-08-26 00:00:00', '2014-10-08 07:33:49'),
