(3, NULL, 3, 4, 'Resource Center', '<h2>Planning a Successful Meeting</h2>\r\n\r\n<p>Trust me, holding a meeting when all you have prepared is a one-page agenda and reproduced some colorful handouts without rehearsing the scenario of outcomes and benefits will just leave you prepared to fall flat on your face. You&rsquo;ll struggle to make up something meaningful.&nbsp;</p>\r\n\r\n<p><em>Here are useful meeting planning tips.</em></p>\r\n\r\n<p><strong>Think it Through</strong>- Ask, <em>What do I want to share? Why do I want to share it? What do I expect from others? What will others gain from the meeting? </em>Asking these essential questions will assist in formulating and refining the focus of&nbsp;your meeting and guide your preparation. Whether it is a sales call or a board meeting, know your&nbsp; personal purpose and expectations</p>\r\n\r\n<p><strong>Make a List</strong>&ndash; List everything you can think of that needs to be covered. Purge your thoughts and expectations. Visual review of the information you want to give and receive can be sorted out according to what can be done ahead of time and what must wait for the meeting.</p>\r\n\r\n<p><strong>Group Your Items</strong>&ndash; Make an outline grouping your items of similar nature together. This will save time and keep the agenda focused.</p>\r\n\r\n<p><strong>Do What You Can </strong><strong>NOW</strong>&ndash; Review each item carefully to determine if some things can be tackled with a brief note, email or phone call. This pairing down will help you devote time to the essential items that take a meeting to discuss.</p>\r\n\r\n<p><strong>Assess Time</strong>&ndash; Give careful thought to the amount of time you think it will take to discuss and reach conclusions. Put a time limit next to each item. You may find that the most important items may not take the most time.</p>\r\n\r\n<p><strong>Lace Your Agenda</strong>&ndash; Now that you have the &ldquo;meat&rdquo; of your meeting add some fun or benefits to those who you have asked to attend. This requires thought from the introductions in the beginning and rewards at the conclusion.</p>\r\n\r\n<p>This strategy can work for large or small meetings. When you ask for a person&rsquo;s time and input, make it worth their while by showing that you have put thought into the agenda and added just the right personal touch to make a statement of appreciation for their attendance and participation.</p>\r\n', 'Policies', 'Business Resource, resource center, african american business resource, coaching, personal coach, business tools, free business information,', 'Policies', 'resource-center', 1, '2014-08-26 00:00:00', '2014-10-13 04:45:06'),
(4, NULL, 5, 6, 'Contact Us', '<h2>We want to hear from you.</h2>\r\n\r\n<h3>Mailing address:</h3>\r\n\r\n<p>Black Business Directory<br />\r\n625 Stanwix Street # 2206<br />\r\nPittsburgh PA 15222</p>\r\n\r\n<p>Telephone: (412) 391-8208<br />\r\nEmail: <a href="mailto:contact@pablackdirectory.com">contact@pittsburghblackdirectory.com</a></p>\r\n', 'Contact Us', 'Contact Us', 'Contact Us', 'contact-us', 1, '2014-08-26 00:00:00', '2014-10-13 03:49:08'),
