(21, NULL, 39, 40, 'BLOG', '<table align="left" border="0" cellpadding="1" cellspacing="1" style="width:100%">\r\n  <tbody>\r\n   <tr>\r\n      <td style="text-align:left; vertical-align:top; width:50%">\r\n     <p><span style="font-size:14px"><span style="color:#000000"><span style="font-family:tahoma,geneva,sans-serif"><strong>BLACK BUSINESS DIRECTORY BLOG</strong><br />\r\n     THE NO TALKING ZONE<br />\r\n     <br />\r\n      It is amazing how time flies and how the mode of communication has evolved since I started in business in 1983. When the Black Business Directory was first published in 1984, I had never heard of the internet, a personal computer or even a fax machine.</span></span></span></p>\r\n\r\n     <p><span style="font-size:14px"><span style="color:#000000"><span style="font-family:tahoma,geneva,sans-serif">Face-to-face meetings, the handshake and signing in person on the dotted line were keys to doing business and for closing a sale. <a href="http://www.pittsburghblackdirectory.com/blog/">more</a></span></span></span></p>\r\n      </td>\r\n     <td style="text-align:left; vertical-align:top; width:35px">&nbsp;&nbsp;&nbsp;&nbsp;</td>\r\n     <td style="text-align:left; vertical-align:top; width:50%">\r\n     <p>&nbsp;</p>\r\n     </td>\r\n   </tr>\r\n </tbody>\r\n</table>\r\n', 'Blog', 'black directory,pittsburgh, pittsburgh black business, black business, african american business, african american black business, african americans, pittsburgh african americans', 'Blog', 'blog', 1, '2014-08-26 00:00:00', '2014-10-13 04:35:41'),
